import { useState } from "react";







const App = () => {

  const [count,setcount] = useState(5);
  

  const Incr = () => {
         setcount(count+5);
  }

  return (
    <>
      <h1>{count}</h1>
      <button onClick={Incr}>Click me</button>
    </>
  )
}

export default App;
